import React from 'react'
import './myStyle.css'
import { LogoNodejs } from 'react-ionicons'


interface data {
    numero: BigInteger;
    frase: string;
}

function Card(props:data) {
  return (
    <div className = 'card' >

        <div className='izquierda'>
            <div className= 'numbers' >{props.numero} </div>
            <div className= 'cardName'>{props.frase}</div>
        </div>

        <div className='iconBx'>
             <LogoNodejs color={'#C9C9C9'}   height="50px" width="50px" />
        </div>

    </div>
  )
}

export default Card;
